import UserList from './components/UserList';

function App() {
  return (
    <div class="container p-5 h-screen bg-gray-100">
      <button class='my-2 px-4 py-2 font-semibold text-sm bg-cyan-500 text-white rounded-full shadow-sm'>
        Add User
      </button>
      <UserList />
    </div>

  );
}

export default App;
